import React, { Component } from "react";
import "./Task12.css";
import Header from "./Header";
import SideBar from "./SideBar";
import Details from "./Details";
import "./lato.ttf";
import WorkSpace from "./WorkSpace";

class Task12 extends Component {
  constructor(props) {
    super(props);
    this.state = {
      current: "filipjovakaric",
      currentImage: undefined,
      showDetails: false,
    };
  }

  handleDetails = () => {
    this.setState({
      showDetails: !this.state.showDetails,
    });
    if (this.state.current === "filipjovakaric") {
      this.setState({
        currentImage:
          "data:image/jpeg;base64,",
      });
    }
    if (this.state.current === "Slackbot") {
      this.setState({
        currentImage:
          "data:image/png;base64,",
      });
    }
    if (this.state.current === "ivorano") {
      this.setState({
        currentImage:
          "data:image/png;base64,",
      });
    }
  };
  handleX = () => {
    this.setState({
      showDetails: false,
    });
  };

  callbackFunction = (childData) => {
    this.setState({ current: childData });
  };
  render() {
    console.log(this.state.showDetails);
    return (
      <div className="entire">
        <Header />

        <div className="sidebar-workspace">
          <SideBar parentCallback={this.callbackFunction} />
          <div className="right">
            <WorkSpace
              handleDetails={this.handleDetails}
              current={this.state.current}
            />
          </div>
          {this.state.showDetails && (
            <Details
              handleImage={this.handleImage}
              handleX={this.handleX}
              currentImage={this.state.currentImage}
              current={this.state.current}
            />
          )}
        </div>
      </div>
    );
  }
}

export default Task12;
